import styled from 'styled-components'
import fetch from 'isomorphic-unfetch'


const Home = ({ data }) => (

  data.map(d => {
    <h1>{d}</h1>
  })

)

export async function getServerSideProps(){
  const res = await fetch('http://localhost:3001/api/university')
  const data = await res.json();

  console.log(data);

  return {props: { data } }
} 


export default Home
